package com.creator.link;

public class BC_DTO {
	String bc_number;
	String bc_hreflink;
	String bc_imglink;
	String bc_profilimglink;
	String bc_profilname;
	String bc_sichengjasu;
	String bc_flaform;
	public BC_DTO() {
		super();
		// TODO Auto-generated constructor stub
	}
	public BC_DTO(String bc_number, String bc_hreflink, String bc_imglink, String bc_profilimglink,
			String bc_profilname, String bc_sichengjasu, String bc_flaform) {
		super();
		this.bc_number = bc_number;
		this.bc_hreflink = bc_hreflink;
		this.bc_imglink = bc_imglink;
		this.bc_profilimglink = bc_profilimglink;
		this.bc_profilname = bc_profilname;
		this.bc_sichengjasu = bc_sichengjasu;
		this.bc_flaform = bc_flaform;
	}
	public String getBc_number() {
		return bc_number;
	}
	public void setBc_number(String bc_number) {
		this.bc_number = bc_number;
	}
	public String getBc_hreflink() {
		return bc_hreflink;
	}
	public void setBc_hreflink(String bc_hreflink) {
		this.bc_hreflink = bc_hreflink;
	}
	public String getBc_imglink() {
		return bc_imglink;
	}
	public void setBc_imglink(String bc_imglink) {
		this.bc_imglink = bc_imglink;
	}
	public String getBc_profilimglink() {
		return bc_profilimglink;
	}
	public void setBc_profilimglink(String bc_profilimglink) {
		this.bc_profilimglink = bc_profilimglink;
	}
	public String getBc_profilname() {
		return bc_profilname;
	}
	public void setBc_profilname(String bc_profilname) {
		this.bc_profilname = bc_profilname;
	}
	public String getBc_sichengjasu() {
		return bc_sichengjasu;
	}
	public void setBc_sichengjasu(String bc_sichengjasu) {
		this.bc_sichengjasu = bc_sichengjasu;
	}
	public String getBc_flaform() {
		return bc_flaform;
	}
	public void setBc_flaform(String bc_flaform) {
		this.bc_flaform = bc_flaform;
	}
	
	
	
}
